        "Vary": "Accept",
    }
  };
const response = "";
//get user input from the chatbot interaction
class RecordView extends Component{



componentDidMount(){

    //send the HTTP GET request
    response = axios.get('/api/chats/');

}

render(){
    return(
        <div>{response}</div>
    )
    }
};


export default RecordView;
